    "Partial pressure (or fugacity) of carbon dioxide, dissolved inorganic carbon,
    temperature, salinity and other variables collected from discrete sample and profile
    observations using CTD, bottle and other instruments from the JOHAN HJORT in the
    North Atlantic Ocean, North Greenland Sea and Norwegian Sea from 1994-07-23 to 1994-08-16
    (NODC Accession 0113560)",nt"tracking_summary": {ntt"total": 1,ntt"recent":
    1nt},nt"groups": [],nt"relationships_as_subject": [],nt"revision_timestamp":
    "2016-02-26T22:16:56.821546",nt"name": "partial-pressure-or-fugacity-of-carbon-dioxide-dissolved-inorganic-carbon-temperature-sali",nt"isopen":
    false,nt"url": null,nt"notes": "NODC Accession 0113560 includes chemical,
    discrete sample, physical and profile data collected from JOHAN HJORT in the North
    Atlantic Ocean, North Greenland Sea and Norwegian Sea from 1994-07-23 to 1994-08-16
    and retrieved during cruise CARINA/58JH19940723. These data include CHLOROFLUOROCARBON-11
    (CFC-11), CHLOROFLUOROCARBON-113 (CFC-113), CHLOROFLUOROCARBON-12 (CFC-12), Carbon
    tetrachloride (CCL4), DELTA CARBON-13, DELTA CARBON-14, DELTA HELIUM-3, DISSOLVED
    INORGANIC CARBON, DISSOLVED OXYGEN, HELIUM, HYDROSTATIC PRESSURE, NITRATE, NITRITE,
    PHOSPHATE, Partial pressure (or fugacity) of carbon dioxide, Potential temperature
    (theta), SALINITY, SILICATE, TRITIUM and WATER TEMPERATURE. The instruments used
    to collect these data include CTD and bottle. These data were collected by J. Olafsson
    of entry withdrawn and J. Blindheim [affiliation unknown] as part of the CARINA/58JH19940723,
    WOCE AR18d data set.The CARINA (CARbon dioxide IN the Atlantic Ocean) data synthesis
    project is an international collaborative effort of the EU IP CARBOOCEAN, and U.S.
    partners. It has produced a merged internally consistent data set of open ocean
    subsurface measurements for biogeochemical investigations, in particular, studies
    involving the carbon system. The original focus area was the North Atlantic Ocean,
    but over time the geographic extent expanded and CARINA now includes data from the
    entire Atlantic, the Arctic Ocean, and the Southern Ocean.",nt"license_title":
